              cy.xpath(instantratesPage.validateDestinationPort).should('have.text', '\n' + rows[0].L3_destination);
              cy.wait(3000);
              cy.xpath(instantratesPage.clickOnViewDetailsButton).click({
                force: true
              });
              cy.wait(2000);
              _instantRatePage_commonMethod.default.clickOnCreateQuote();
              cy.wait(2000);
              _instantRatePage_commonMethod.default.clickOnProvideQuoteDetails();
              _generateQuotationPage_commonMethod.default.generateQuatotation();
              cy.wait(5000);
              cy.log("get the inquiry ID");
              cy.get('.inquiry-id').invoke('text').as('inquiryId_FCL');
              cy.log("Click on View Quotes");
              _generateQuotationPage_commonMethod.default.clickOnViewQuote();
              cy.wait(5000);
              cy.xpath(quotesDetailspage.quotesPagetitleNummber).invoke('text').as('QuotesId_FCL');
              cy.get('@QuotesId_FCL').then(quoteId => {
                cy.get('@inquiryId_FCL').then(inquiryId => {
                  _quotesPage_commonMethod.default.verifyQuotesIdText(quoteId);
                  _quotesPage_commonMethod.default.verifyInquiryIdText(inquiryId);
                  _quotesPage_commonMethod.default.verifyOriginPort(rows[i].L3_origin);
                  _quotesPage_commonMethod.default.verifyDestinationPort(rows[i].L3_destination);
                  _quotesPage_commonMethod.default.verifyMode("SEA_FCL");
                  cy.xpath("//div[text()[normalize-space()='" + inquiryId + "']]").click({
                    force: true
                  });
                  _quotesPage_commonMethod.default.verifyOriginPort(rows[i].L3_origin);
                  _quotesPage_commonMethod.default.verifyDestinationPort(rows[i].L3_destination);
                  _quotesPage_commonMethod.default.verifyMode("SEA_FCL");
                });
              });
            });
          });
        }
      });
    });
  });
});

